import React from 'react';
import { TextInput, StyleSheet } from 'react-native';

const Input = props => {
  return <TextInput 
   {...props}
   style={styles.input}
   blurOnSubmit
   autoCapitalize="none"
   keyboardType="numbers-and-punctuation"
   maxLength={2}
   />;
};

const styles = StyleSheet.create({
  input: {
    height: 30,
    borderBottomColor: 'grey',
    borderBottomWidth: 1,
    marginVertical: 10,
    width: 50,
    textAlign: 'center'
  }
});

export default Input;
